import React from 'react';

import AuthEstabelecimentoContext from './contexts/auth-estabelecimento';

import Routes from './routes';

export default function App() {
  return (
    <AuthEstabelecimentoContext.Provider>
      <Routes />
    </AuthEstabelecimentoContext.Provider>
  )
}
